test_list_of_tens:
assert {2} == {2, 5}
  Extra items in the right set:
  5
  Full diff:
  - {2, 5}
  + {2}

test_list_of_primes:
assert set() == {2}
  Extra items in the right set:
  2
  Full diff:
  - {2}
  + set()

test_powers_of_two:
assert {2, 4, 19, 38} == {2}
  Extra items in the left set:
  19
  4
  38
  Full diff:
  - {2}
  + {2, 19, 4, 38}
